import jeans_images from "../images/fitjeans.jpg";
import { Link } from "react-router-dom";

const ProductCard = () => {
  return (
    <div class="card">
      <img
        src={jeans_images}
        class="card-img-top rounded mx-auto d-block m-2"
        alt="img"
        style={{
          maxHeight: "270px",
          maxWidth: "100%",
          width: "auto",
        }}
      />

      <div class="card-body">
        <h5 class="card-title d-flex justify-content-between">
          <Link
            to="/"
            style={{
              textDecoration: "none",
              color: "black",
            }}
          >
            Black Jeans
          </Link>
          <Link
            to="/"
            style={{
              textDecoration: "none",
              color: "chocolate",
            }}
          >
            <i>cloth</i>
          </Link>
        </h5>
        <p class="card-text">
          Awesome Looking Black Strectable Jean with rough tone. Classical
          Looking Jeans....
        </p>
      </div>
      <div class="card-footer">
        <p>
          <span class="ml-2">
            <b
              style={{
                color: "green",
              }}
            >
              Price : &#8377;999.00/-
            </b>
          </span>
        </p>
        <p
          style={{
            color: "red",
          }}
        >
          <s>&#8377;1199.00</s>/-
        </p>
      </div>

      <div className="d-flex justify-content-between">
        <span class="ml-2">Stock : 100</span>
      </div>
    </div>
  );
};

export default ProductCard;
